jQuery(document).ready(function() {
    //
    $.each(oJson,function(i,v){
        $("#province").append("<option value='" + v.province_id + "'>" + v.province_name+ "</option>");
    });
    //    //renderArea()
    //    //renderCity()
});
function renderCity(){
    var pid = $("#province").find('option:selected').val();
    $(".province").html($("#province").find('option:selected').html())
//            console.log(pid);
    if(pid!='0'){
        for(var i=0;i<oJson.length;i++){
            if(oJson[i].province_id==pid){
//                      console.log(oJson[i])
                $("#city").empty();
                $("#area").empty();
                $(".city").html("请选择城市");
                $(".area").html("请选择地区");
                $("#city").append("<option value='0'>请选择城市</option>");
                $("#area").append("<option value='0'>请选择地区</option>");
                $.each(oJson[i].city,function(i,cv){
                    $("#city").append("<option value='" + cv.city_id + "'>" + cv.city_name+ "</option>");
                });
                return false;
            }
        }
    }

}
function renderArea(){
    var pid = $("#province").find('option:selected').val();
    var cid = $("#city").find('option:selected').val();
    $(".city").html($("#city").find('option:selected').html());
//            alert(cid)
    if(pid!='0'&&cid!='0'){
        for(var i=0;i<oJson.length;i++){
            if(oJson[i].province_id==pid){
//                        console.log(oJson[i].city)
                for(var c=0;c<oJson[i].city.length;c++){
                    if(oJson[i].city[c].city_id==cid){
                        for(var d=0;d<oJson[i].city[c].country.length;d++){
                            $("#area").append("<option value='" + oJson[i].city[c].country[d].country_id + "'>" +oJson[i].city[c].country[d].country_name+ "</option>");
                        }
                    }
                }
            }
        }
    }
}
function area(){
    $(".area").html($("#area").find('option:selected').html());
}